(function () {
'use strict';

var wrapper = document.querySelector('.wrapper');
var popupBg = document.querySelector('.popup-bg');
var closePopupBtn = document.querySelector('#close-popup');
var popups = document.querySelectorAll('.popup');

function closePopups() {
  popups.forEach(function (popup) {
    popup.classList.remove('visible');
    wrapper.classList.remove('blur');
    popupBg.classList.remove('visible');
  });
}

function showPopup(popup) {
  popup.classList.add('visible');
  wrapper.classList.add('blur');
  popupBg.classList.add('visible');
}

closePopupBtn.addEventListener('click', closePopups);

// радио-элемент для смены вида
var view = document.querySelectorAll('.change-view__hidden');
// список фото
var photos = document.querySelector('.photos-collection__list');

// изменение отображения списка фото в зависимости от предпочтений пользователя
view[0].onchange = function () {
  if (view[0].checked) {
    photos.classList.add('grid-list');
    photos.classList.remove('std-list');
  } else {
    photos.classList.remove('grid-list');
    photos.classList.add('std-list');
  }
};

view[1].onchange = function () {
  if (view[1].checked) {
    photos.classList.remove('grid-list');
    photos.classList.add('std-list');
  } else {
    photos.classList.add('grid-list');
    photos.classList.remove('std-list');
  }
};

// отображение попапа с выбранным фото

// попап для изображения
var imgPopup = document.querySelector('.img-popup');
// коллекция изображений
var images = document.querySelectorAll('.photos-collection__list-item');

function takeCloserLook() {
  images.forEach(function (image) {
    image.addEventListener('click', function () {
      imgPopup.innerHTML = image.innerHTML;
      showPopup(imgPopup);
    });
  });
}

takeCloserLook();

}());
